function generateTimeDropdown() {
  const now = new Date();

  // Округляем текущее время до ближайших 10 минут
  const nextInterval = new Date(now);
  nextInterval.setMinutes(Math.ceil(now.getMinutes() / 10) * 10);
  nextInterval.setSeconds(0);
  nextInterval.setMilliseconds(0);

  // Хранилище для временных интервалов
  const options = [];

  // Рассчитываем сколько интервалов нужно до следующего дня
  const endOfDay = new Date(now);
  endOfDay.setHours(24, 0, 0, 0); // Устанавливаем конец дня в 00:00 следующего дня

  // Перебираем интервалы до конца следующего дня
  while (nextInterval < endOfDay) {
    const label = nextInterval.toLocaleTimeString("en-GB", {
      hour: "2-digit",
      minute: "2-digit",
    });
    const value = nextInterval.toISOString();

    // Добавляем временной интервал в список
    options.push({
      key: value,
      value: value,
      label: label,
    });

    // Переход к следующему интервалу
    nextInterval.setMinutes(nextInterval.getMinutes() + 10);
  }

  return options;
}

interface Session {
  sessionId: string;
  startTime: string; // ISO
  endTime: string; // ISO
}

interface Booking {
  pcId: string;
  sessions: Session[];
}

export function generateBookings(): Booking[] {
  const bookings: Booking[] = [];

  const now = new Date();
  now.setHours(17, 0, 0, 0); // Начало расчёта (17:00)
  const endOfDay = new Date(now);
  endOfDay.setHours(24, 0, 0, 0); // Конец дня (00:00 следующего)

  // Выбираем случайные PC ID
  const selectedPcIds = pcIdList
    .sort(() => 0.5 - Math.random())
    .slice(0, Math.floor(pcIdList.length / 2));

  selectedPcIds.forEach((pcId) => {
    const sessions: Session[] = [];

    let currentTime = new Date(now);
    currentTime.setMinutes(
      currentTime.getMinutes() + Math.floor(Math.random() * 241)
    ); // случайное смещение на 0–240 мин

    while (currentTime < endOfDay && sessions.length < 3) {
      const maxSessionDurationHours = Math.min(
        6,
        (endOfDay.getTime() - currentTime.getTime()) / (1000 * 60 * 60)
      );
      const sessionDurationHours =
        Math.floor(Math.random() * maxSessionDurationHours) + 1;

      const startTime = new Date(currentTime);
      const endTime = new Date(currentTime);
      endTime.setHours(endTime.getHours() + sessionDurationHours);

      if (endTime <= endOfDay) {
        sessions.push({
          sessionId: Math.random().toString(36).substr(2, 9),
          startTime: startTime.toISOString(),
          endTime: endTime.toISOString(),
        });

        currentTime = new Date(endTime);
      } else {
        break;
      }

      // Добавим паузу 10–30 минут
      currentTime.setMinutes(
        currentTime.getMinutes() + Math.floor(Math.random() * 21) + 10
      );
    }

    if (sessions.length > 0) {
      bookings.push({ pcId, sessions });
    }
  });

  return bookings;
}

const formatTimeToText = (isoDateString: string): string => {
  const date = new Date(isoDateString);
  return date.toLocaleTimeString("ru-RU", {
    hour: "2-digit",
    minute: "2-digit",
    hour12: false,
  });
};

const getTimeLeftText = (futureTime: string): string => {
  const diffMs = new Date(futureTime).getTime() - Date.now();
  const diffMinutes = Math.floor(diffMs / 1000 / 60);
  const hours = Math.floor(diffMinutes / 60);
  const minutes = diffMinutes % 60;

  if (diffMinutes <= 0) return "менее минуты";

  return `${hours > 0 ? `${hours} ч ` : ""}${minutes} мин`;
};

const getRelevantSession = (sessions: Session[] = []): Session | null => {
  const now = new Date();
  let relevantSession: Session | null = null;

  for (const session of sessions) {
    const sessionStart = new Date(session.startTime);
    const sessionEnd = new Date(session.endTime);

    if (now >= sessionStart && now < sessionEnd) {
      return session;
    } else if (now < sessionStart) {
      if (
        !relevantSession ||
        sessionStart < new Date(relevantSession.startTime)
      ) {
        relevantSession = session;
      }
    }
  }

  return relevantSession;
};

const isTimeInRange = (
  selectedTimeISO: string,
  from: string,
  to: string
): boolean => {
  const selectedDate = new Date(selectedTimeISO);
  const selectedMinutes =
    selectedDate.getHours() * 60 + selectedDate.getMinutes();

  const [fromH, fromM] = from.split(":").map(Number);
  const [toH, toM] = to.split(":").map(Number);

  const fromMinutes = fromH * 60 + fromM;
  const toMinutes = toH * 60 + toM;

  if (fromMinutes <= toMinutes) {
    return selectedMinutes >= fromMinutes && selectedMinutes < toMinutes;
  } else {
    return selectedMinutes >= fromMinutes || selectedMinutes < toMinutes;
  }
};

